import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
    table: {
        maxWidth: '30%'
    },
    tableComp: {
        maxWidth: '35%'
    }
});

function createData(bpm, date) {
    return { bpm , date };
  }

const rows = [
    createData(72, "2021-02-07 14:27:33"),
    createData(72, "2021-02-07 14:27:32"),
    createData(72, "2021-02-07 14:27:34"),
    createData(72, "2021-02-07 14:27:36"),
    createData(72, "2021-02-07 14:27:38"),
];

export default function Component() {

    const classes = useStyles();

    return (
        <TableContainer component={Paper} classes={classes.tableComp}>
        <Table className={classes.table} aria-label="simple table">
            <TableHead>
            <TableRow>
                <TableCell>Beats Per Minute</TableCell>
                <TableCell align="right">Date</TableCell>
            </TableRow>
            </TableHead>
            <TableBody>
            {rows.map((row) => (
                <TableRow key={row.bpm}>
                <TableCell component="th" scope="row">
                    {row.bpm}
                </TableCell>
                <TableCell align="right">{row.date}</TableCell>
                </TableRow>
            ))}
            </TableBody>
        </Table>
        </TableContainer>
    );
}
